import React from 'react';
import { Container, Row, Col} from "react-bootstrap";
import RecipeList from "../components/RecipeList";

const Main = () => {
        return (
            <Container>
                <Row>
                    <Col md={3}>
                    <RecipeList/>
                    </Col>
                </Row>
            </Container>
        );
};

export default Main;
